function Fiche_logement() {
  return (
    <>
      {Logements.map((data, index) => (
        <Carrousel key={index} img_carrousel={data.pictures} />
      ))}
      <h2>Cozy logt on the Canal Saint-Martin</h2>
      <p>Paris, île-de-France</p>
      <p>Alexandre Dumas</p>
      <img src="logements.host.picture"></img>
      <Tag type_tag="Cozy" titre_collapse="Cozy" />
      <Tag type_tag="Canal" titre_collapse="Canal" />
      <Tag type_tag="Paris 10" titre_collapse="Paris 10" />
    </>
  );
}

export default Fiche_logement;
